script: |
  super -f text -I q6630.spq | sort > q6630.out

inputs:
  - name: q6630.spq
    data: |
      SELECT DISTINCT + col0 * 86 + + cor0.col0 * + cor0.col2 + - col0 / 56 AS col2 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q6630.out
    data: |
      14559
      420
      9151
